import React from "react";

const PayslipRow = ({ slip, onDelete, onDownload }) => {
  return (
    <tr>
      <td>{slip.PayslipID}</td>
      <td>{slip.UserID}</td>
      <td>{slip.MonthYear}</td>
      <td>{slip.NetSalary}</td>
      <td>
        <button
          className="payslips-download-btn"
          onClick={() => onDownload(slip.PayslipID, slip.UserID, slip.MonthYear)}
        >
          Download
        </button>
      </td>
      <td>
        <button
          className="payslips-delete-btn"
          onClick={() => onDelete(slip.PayslipID)}
        >
          Delete
        </button>
      </td>
    </tr>
  );
};

export default PayslipRow;
